import React from 'react';
import { Link } from '@reach/router';

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

import NavbarLogo from '../img/navbarLogo.png';

const SiteNavbar = () => {
	return (
		<Navbar bg="primary" expand="lg" style={{ padding: '1rem 2rem' }}>
			<Navbar.Brand>
				<Link to="/">
					<img
						src={NavbarLogo}
						alt="navbar logo"
						style={{
							width: '4rem',
						}}
					/>
				</Link>
			</Navbar.Brand>
			<Navbar.Toggle aria-controls="basic-navbar-nav" />
			<Navbar.Collapse id="basic-navbar-nav">
				<Nav className="ml-auto">
					<Link to="/">
						<p>Home</p>
					</Link>
					<Link to="/about">
						<p>About</p>
					</Link>
					<Link to="/team">
						<p>Team</p>
					</Link>
					<Link to="/">
						<p>Blog</p>
					</Link>
					<Link to="/sponsors">
						<p>Sponsors</p>
					</Link>
					<Link to="/join">
						<p>Join Us</p>
					</Link>
				</Nav>
			</Navbar.Collapse>
		</Navbar>
	);
};

const style = {
	NavLink: {
		padding: '0 1rem',
	},
};

export default SiteNavbar;
